package com.synel.synergy.synergy2416.persistent;

import static org.junit.Assert.*;

import java.util.ArrayList;
import java.util.List;

import org.junit.After;
import org.junit.Before;
import org.junit.Ignore;
import org.junit.Test;

public class HbmFingerPrintDaoTest {

	private List<FingerPrintPOJO> mFps;
	private final String[] fpsamples = {""
     ,""
     ,""
     ,""
     ,""
     ,""
     ,""
     ,""
     ,""
     ,""
	};
	private final int[] index2uid={2,3,7,8,12,13,17,18,22,27};
	/*
 * UID: 2 Template: 
UID: 3 Template: 
UID: 7 Template: 
UID: 8 Template: 
UID: 12 Template: 
UID: 13 Template: 
UID: 17 Template: 
UID: 18 Template: 
UID: 22 Template: 
UID: 27 Template: 

 */
	@Before
	public void setUp() throws Exception {
			mFps = new ArrayList<FingerPrintPOJO>();
			for(int i=0; i<fpsamples.length;i++){
				FingerPrintPOJO fp= new FingerPrintPOJO();
				fp.setFingerNum(0);
				fp.setUserId(index2uid[i]);
				fp.setTemplate(fpsamples[i]);
				mFps.add(fp);
			}
	}

	@After
	public void tearDown() throws Exception {
	}
	
	@Test
	public void masterTestSuites(){
        testSaveFingerprint();
		testSaveFingerprints();
		testGetFingerPrintCount();
		testGetDirtyFingerPrints();
		testGetAllFingerPrints();
		testUpdateFingerPrintSyncStatus();
		testGetDirtyFingerPrints();
		testUpdateFingerPrintTemplate();
		testDeleteFingerPrints();
		testGetFingerPrintCount();	
	    testDeleteFingerPrint();
	    testGetFingerPrintCount();
	}
    
	@Test
	@Ignore
	public void testGetAllFingerPrints() {
		FingerPrintDao fpDao = new HbmFingerPrintDao();
		List<FingerPrintPOJO> fps = fpDao.getAllFingerPrints();
		printListOfFingerPrints(fps);
	}

	@Test
	@Ignore
	public void testGetFingerprint() {
		
		FingerPrintDao fpDao = new HbmFingerPrintDao();
		FingerPrintPOJO fp = fpDao.getFingerprint(200, 0);
		System.out.println(fp.toString());
	}
	
	@Test
	@Ignore
	public void testSaveFingerprint(){
		
		System.out.println("Template len: "+fpsamples[0].length());
		FingerPrintPOJO fp = new FingerPrintPOJO();
		fp.setFingerNum(0);
		fp.setUserId(200);
		fp.setTemplate(fpsamples[0]);
		FingerPrintDao fpDao = new HbmFingerPrintDao();
		fpDao.saveFingerprint(fp);
	}

	@Test
	@Ignore
	public void testSaveFingerprints() {
		
		FingerPrintDao fpDao = new HbmFingerPrintDao();
		fpDao.saveFingerprints(mFps);
	}
	
	@Test
	@Ignore
	public void testUpdateFingerPrintSyncStatus() {
		FingerPrintDao fpDao = new HbmFingerPrintDao();
		int res = fpDao.updateFingerPrintSyncStatus(2, 0, true);
		System.out.println("updated sync status: "+res);
	}
	
	@Test
	@Ignore
	public void testUpdateFingerPrintTemplate() {
		
		FingerPrintDao fpDao = new HbmFingerPrintDao();
		int res = fpDao.updateFingerPrintTemplate(2, 0, fpsamples[1]);
		System.out.println("Result is : "+res);
		fpDao.updateFingerPrintTemplate(2,0,fpsamples[0]);
	}

	@Test
	@Ignore
	public void testDeleteFingerPrint() {
		
		FingerPrintDao fpDao = new HbmFingerPrintDao();
		int res = fpDao.deleteFingerPrint(3, 0);
		System.out.println("Result: "+res);
	}

	@Test
	@Ignore
	public void testDeleteFingerPrints() {
		
		FingerPrintDao fpDao = new HbmFingerPrintDao();
		int res = fpDao.deleteFingerPrints(7);
		System.out.println("Result: "+res);
	}

	@Test
	@Ignore
	public void testGetFingerPrintCount() {
		
		FingerPrintDao fpDao = new HbmFingerPrintDao();
		int res = fpDao.getFingerPrintCount();
		System.out.println("FingerPrint count is: "+res);
		
	}

	@Test
	@Ignore
	public void testGetDirtyFingerPrints() {
	
		FingerPrintDao fpDao = new HbmFingerPrintDao();
		List<FingerPrintPOJO> fps = fpDao.getDirtyFingerPrints();
		printListOfFingerPrints(fps);
	}

	private void printListOfFingerPrints(List<FingerPrintPOJO> fps) {
		for(FingerPrintPOJO fp:fps){
			System.out.println(fp.toString());
		}
	}
}
